import React, { Component } from 'react';

export default class CardsSaves extends Component {
  render() {
    const { cards } = this.props;
    console.log(cards);

    return (
      <div>
        <ul>
          { cards.map((card) => (
            <li>{ card }</li>
          )) }
        </ul>
      </div>
    );
  }
}
